export const suishiModelAnimation = (bool, opacity = 0.3) => {
    if (bool) {
        suishiDonghuaMesh.forEach((item) => {
            item.material.transparent = true;
            item.material.opacity = opacity;
            item.renderOrder = 500;
        });
    } else {
        suishiDonghuaMesh.forEach((item) => {
            item.material.opacity = 1;
        });
    }
};

